package bak;

import java.util.HashSet;

public class Hashset {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//Integer
		HashSet<Integer> set = new HashSet<Integer>();
		
		set.add(1);
		set.add(2);
		set.add(3);
		set.add(1);
		
		//String
		HashSet<String> set2 = new HashSet<String>();
		
		set2.add("a");
		set2.add("b");
		set2.add("c");
		set2.add("a");
	}

}
